import React, { useEffect, useState } from "react";
import { ListBox } from "primereact/listbox";
import questData from "./data/db.json"

const QuestList = () => {
  const [selectedQuest, setSelectedQuest] = useState(null);
  const [questDisplay, setQuestDisplay] = useState(null);

  // const output = questData.quests.map(q => q)

  useEffect(() => {
    fetch('http://localhost:8000/quests')
    .then(res => {
      return res.json();
    })
    .then((data) => {
      setQuestDisplay(data);
    });
  }, [])

  return (
    <div className="card">
      <h3>Quests</h3>
      <ListBox
        value={selectedQuest}
        options={questDisplay}
        onChange={(e) => setSelectedQuest(e.value)}
        optionLabel="name"
        style={{ width: "15rem" }}
      />
    </div>
  );
};

export default QuestList;
